  \"2013-03-15T14:37:20.989377\",\n\t\"name\": \"waterhydro-vhdcarto\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"VHDCARTO is a simplified version of the
  local resolution Vermont Hydrography Dataset (VHD) that has been enriched with stream
  perenniality, e.g., \"intermittent\" vs. \"perennial\", as well as, Strahler stream
  order attribution for the single linear feature class only. The primary means of
  accessing this information cartographically is via the FCODE and STREAM_ORDER fields,
  respectively. See the Entity and Attribution Information section for details. NOTE!
  Perenniality data does not exist for stream reaches contained within, or intersected
  by, Essex or Caledonia counties, thus the FCODE \"46000\" in these areas. The absence
  of Soil SUrvey GeOgraphic (SSURGO) database information in these areas precluded
  the computation of perenniality. These areas will be processed at some future date.
  For information on the FCODE symbol for attribution or analysis see the following
  document http://nhd.usgs.gov/NHDinGEO_FCodes_by_layer.pdf (NHDFlowline). A two dimensional
  feature class for lakes, ponds and larger streams is also included in VHDCARTO.
  Both layers are derived from the latest National Hydrography Dataset (NHD) data.
  The NHD is a feature-based database that interconnects and uniquely identifies the
  stream segments or reaches that make up the nation's surface water drainage system.
  For information on the science behind computing perenniality attribution please
  refer to the following U.S. Geological Survey Scientific Investigative Report (SIR)
  # 2006-5217 - http://pubs.usgs.gov/sir/2006/5217/pdf/SIR2006-5217_report.pdf\",\n\t\"license_title\":
